import React from 'react';
import Yearlyslider from './Yearlyslider';
import Yearlyamount from './Yearlyamount';
export default function Slider(isChecked) {
  return (
    <>
      {' '}
      {isChecked ? <Yearlyamount isChecked={isChecked} /> : <Yearlyslider />}
    </>
  );
}
